  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of the survey is to inform
  a regional effort to estimate the distribution and total number of wintering swans
  in Western North America.   The survey supports objectives from the regional plan,
  u201cPacific Flyway Implementation Plan for the Rocky Mountain Population of Trumpeter
  Swan (2002).  Objective 1 calls for redistributing trumpeter swans to areas outside
  the Core Tri-State Area and objective 5 calls for monitoring the population. All
  surveys may be completed by a single observer. Unit name and a GPS location will
  be taken of the pair, and can be recorded incidentally at any time during the survey
  season.This is a ground count that is coordinated with an aerial count, birds will
  be recorded by species and aged to either juvenile or adult.\",\n\t\"license_title\":
